import React from 'react';
import'./Header.css';


const Header = () => {
    return (
      // <div className="header">
      //   <a  className ="link" href="/">Homepage</a>
      //  </div>
        <Navbar bg="light" expand="lg"className="header" >
          <Navbar.Brand href="/">Homepage</Navbar.Brand>            
        </Navbar>
    );

};

export default Header;
